import React from 'react';
import { MDBBtn, MDBBtnGroup } from "mdbreact";
import '../styles/RouterPanel.css'

const SimulationOptions = (props) => {


    return (
    <MDBBtnGroup style={{display:'flex', flexDisplay:'row'}} size="lg">
        <MDBBtn color="deep-purple" onClick={()=>props.toogleShowRadius()}>Wifi Ranges</MDBBtn>
        <MDBBtn color="deep-purple" onClick={()=>props.toogleIntruder()}>Intruder</MDBBtn>
    </MDBBtnGroup>
    );
}

export default SimulationOptions;
